/*
* Given two strings s and t, return true if t is an anagram of s, and false otherwise.
*
* Example 1:
* Input: s = "anagram", t = "nagaram"
* Output: true
*
* Example 2:
* Input: s = "rat", t = "car"
* Output: false
*
* Constraints:
* 1 <= s.length, t.length <= 5 * 104
* s and t consist of lowercase English letters.
*
* Follow up: What if the inputs contain Unicode characters? How would you adapt your solution to such a case?
*
*/
package com.leetcode.practice;

import java.util.HashMap;
import java.util.Map;

public class ValidAnagram {

    public static boolean isAnagram(String s, String t) {
        boolean result;
        Map<String, Integer> sMap= new HashMap<>();
        Map<String, Integer> tMap= new HashMap<>();
        for(Character c: s.toCharArray()){
            sMap.put(Character.toString(c), sMap.getOrDefault(Character.toString(c),0)+1);
        }
        for(Character c: t.toCharArray()){
            tMap.put(Character.toString(c), tMap.getOrDefault(Character.toString(c),0)+1);
        }
        result = sMap.size() == tMap.size();
        if(result && !sMap.isEmpty() && !tMap.isEmpty()){
            for(Character c: s.toCharArray()){
                result = tMap.get(Character.toString(c)) != null ? sMap.get(Character.toString(c)).compareTo(tMap.get(Character.toString(c))) == 0 : false;
                if(!result){
                    break;
                }
            }
        }
        return result;
    }

    public static void main(String[] args) {
        System.out.println(isAnagram("anagram", "nagaram"));
        System.out.println(isAnagram("rat", "car"));
        System.out.println(isAnagram("aa", "a"));
        System.out.println(isAnagram("", ""));
    }
}
